import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import StaffDashboard from "../../shared/StaffDashboard"; // 工作人员管理页面
import QueueForm from "../../frontend/src/components/QueueForm";
import RestaurantSelector from "../../frontend/src/components/RestaurantSelector";

const App = () => {
  return (
    <Router>
      <Routes>
        {/* 通用选择页面 */}
        <Route path="/" element={<RestaurantSelector />} />

        {/* 顾客端页面 */}
        <Route path="/customer/:restaurantId" element={<QueueForm />} />
        <Route path="/staff/:restaurantId" element={<StaffDashboard />} /> {/* 替换组件 */}
      </Routes>
    </Router>
  );
};

export default App;
